{"title":"Analysis Results Wordcloud [Virustotal Filebeat] ","type":"vega","aggs":[],"params":{"spec":"{
  $schema: "https://vega.github.io/schema/vega/v5.json"
  data: [
    {
      name: engines
      url: {
        %context%: true
        %timefield%: @timestamp
        index: "filebeat-*"
        body: {
          aggs: {
            engines: {
              nested: {
                path: "virustotal.analysis.results"
              },
              aggs: {
                values: {
                  terms: {
                    size: 100
                    field: "virustotal.analysis.results.result" 
                  }
                }
              }
            }
          }
          size: 0
        }
      }
      format: { property: "aggregations.engines.values.buckets" }
      transform: [
        {
          "type": "formula", "as": "angle",
          "expr": "0"
        },
        {
          "type": "formula", "as": "weight",
          "expr": "datum.doc_count"
        }
      ]
    }
  ]

  "signals": [
    {
      "name": "wordclick",
      "value": "",
      "on": [
        {
          "events": "text:click",
          "update": '''
          kibanaAddFilter({"nested": {"path": "virustotal.analysis.results", "query": {"bool": {"must": [{ "match": { "virustotal.analysis.results.result":  event.item.text  } }]}}}})
          '''
        }
      ]
    }
  ]

  scales: [
    {
      name: "color"
      type: "ordinal"
      domain: { data: "engines", field: "key" }
      range: {"scheme": "elastic"}
    }
  ]

  marks: [
    {
      name: cloud
      type: text
      from: {data: "engines"}
      encode: {
        enter: {
          text: {field: "key"}
          align: {value: "center"}
          baseline: {value: "alphabetic"}
          fill: {scale: "color", field: "key"}
        },
        update: {
          fillOpacity: {value: 1}
        },
        hover: {
          fillOpacity: {value: 0.5}
        }

      }
      transform: [
        {
          type: wordcloud
          text: {field: "datum.key"}
          size: [{signal: "width"}, {signal: "height"}],
          rotate: {field: "datum.angle"}
          font: "Helvetica Neue, Arial"
          fontSize: {field: "datum.doc_count"}
          fontWeight: {field: "datum.weight"}
          fontSizeRange: [8, 72]
          padding: 4
        }
      ]
    }

  ]
}"}}

{"title":"Detection Counts By Engine [VirusTotal Filebeat] ","type":"vega","aggs":[],"params":{"spec":"{
  $schema: https://vega.github.io/schema/vega-lite/v4.json
  title: Event counts from all indexes
  // Define the data source
  data: {
    url: {
      // Apply dashboard context filters when set
      %context%: true
      // Filter the time picker (upper right corner) with this field
      %timefield%: @timestamp

      // Which index to search
      index: filebeat-8.0.0
      body: {
        size: 0
        aggs: {
          "results": {
            "nested": {
              "path": "virustotal.analysis.results"
            },
            "aggs": {
              "table": {
                "composite": {
                  "size": 1000,
                  "sources": [
                    {"engine_name": {"terms": {"field": "virustotal.analysis.results.engine_name"}}},
                    {"category": {"terms": {"field": "virustotal.analysis.results.category"}}}
                  ]
                }
              }
            }
          }
        }
      }
    }
    name: kibana

    // From the result, take just the data we are interested in
    format: {
      property: aggregations.results.table.buckets
    }
    // Convert key.stk1 -> stk1 for simpler access below
    transform: [
      {
        type: formula
        expr: datum.key.engine_name
        as: engine_name
      }
      {
        type: formula
        expr: datum.key.category
        as: category
      }
      {
        type: formula
        expr: datum.doc_count
        as: count
      }
    ]
  }

  // "mark" is the graphics element used to show our data.  Other mark values are: area, bar, circle, line, point, rect, rule, square, text, and tick.  See https://vega.github.io/vega-lite/docs/mark.html
  mark: text

  // "encoding" tells the "mark" what data to use and in what way.  See https://vega.github.io/vega-lite/docs/encoding.html
  encoding: {
    x: {
      // The "key" value is the timestamp in milliseconds.  Use it for X axis.
      field: key.category
      type: ordinal
      axis: {
        title: Category
      } // Customize X axis format
    }
    y: {
      // The "doc_count" is the count per bucket.  Use it for Y axis.
      field: key.engine_name
      type: ordinal
      axis: {
        title: Engine Name
      }
    }
  }
  layer: [
    {
      "mark": "rect",
      "encoding": {
        "color": {
          "field": "doc_count",
          "type": "quantitative",
          "title": "Count of Records",
          "legend": {"direction": "horizontal", "gradientLength": 120}
        }
      }
    },
    {
      mark: text
      encoding: {
        text: {
          field: doc_count
          type: quantitative
        }
        "color": {
          "condition": {"test": "datum['doc_count'] < 40", "value": "black"},
          "value": "white"
        }
      }
    }
  ]
  config: {
    axis: {
      grid: true
      tickBand: extent
    }
  }
}"}}
